import { BrowserRouter, Route, Routes } from "react-router-dom";
// import { lazy } from "react";
// import { Suspense } from "react";
import React, { useState } from 'react';
import { Navigate } from "react-router-dom";
import FlightTracker from "../components/FlightTracker";
// import Auth from "../components/Auth";
import AdminLogin from "../components/AdminLogin";
import Admindash from "../components/Admindash";
import "bootstrap/dist/css/bootstrap.min.css"

import SignUp from "../components/SignUp";
// const Home = lazy(() => import("../pages/Home"));
import BrowsePage from "../pages/BrowsePage"

const RoutePaths = () => {
  const [flights, setFlights] = useState([]);

  const handleFlightsData = (flightsData) => {
    setFlights(flightsData);
  };

  return (
    <BrowserRouter>

        <Routes>
        <Route path="/" element={<Navigate to="/auth" />}></Route>
          {/* <Route path="/FlyM/" element={<Home />}></Route> */}
          <Route path="/FlyM/browse-page" element={<BrowsePage onFlightsData={handleFlightsData} />}></Route>
          <Route path="/page" element={<FlightTracker />}></Route>
          <Route path="/admin" element={<AdminLogin />}></Route>
          <Route path="/dash" element={<Admindash flights={flights} />}></Route>
          <Route path="/auth" element={<SignUp /> }></Route>
        </Routes>

    </BrowserRouter>
  );
};

export default RoutePaths;
